import React, {Component} from 'react';
import Card from '../components/Card';
import NavbarPage from '../components/NavBarPage'


class Incomplete extends Component{
  IncompleteCards() {


    return (
        <div>
            {turtles.map((turtle, index) =>
            <div key={turtle.name + index}>
                <h1>{turtle.name} ({turtle.nickName})</h1>
                <p>Weapon of choice: {turtle.weapon}</p>
                <img src={turtle.imgUrl} alt={`${turtle.name}`} width="200"/>
                <hr/>
            </div>
            )}
        </div>
    )
}

  render(){
    const turtles = [
      {
          title: "Dominos",
          cost: "14.38",
          description: "Pasta & Wings",
          imgUrl: "https://upload.wikimedia.org/wikipedia/en/e/ed/Leonardo_%28Teenage_Mutant_Ninja_Turtles%29.jpg"
      },
      {
        title: "Dominos",
        cost: "14.38",
        description: "Pasta & Wings",
        imgUrl: "https://upload.wikimedia.org/wikipedia/en/e/ed/Leonardo_%28Teenage_Mutant_Ninja_Turtles%29.jpg"
    },
    {
      title: "Dominos",
      cost: "14.38",
      description: "Pasta & Wings",
      imgUrl: "https://upload.wikimedia.org/wikipedia/en/e/ed/Leonardo_%28Teenage_Mutant_Ninja_Turtles%29.jpg"
  },
  {
    title: "Dominos",
    cost: "14.38",
    description: "Pasta & Wings",
    imgUrl: "https://upload.wikimedia.org/wikipedia/en/e/ed/Leonardo_%28Teenage_Mutant_Ninja_Turtles%29.jpg"
},
      {
          name: "Michelangelo",
          nickName: "Mikey",
          weapon: "Nunchucks",
          imgUrl: "https://upload.wikimedia.org/wikipedia/en/f/f3/Michelangelo_%28Teenage_Mutant_Ninja_Turtles%29.jpg"
      },
      {
          name: "Raphael",
          nickName: "Raph",
          weapon: "Sai",
          imgUrl: "https://upload.wikimedia.org/wikipedia/en/7/72/Raphael_%28Teenage_Mutant_Ninja_Tutles%29.jpg"
      }
  ]
    return (
      <div>
        <NavbarPage/>
      <div className='homeRow'>
        <Card title="Dominos" cost="14.38" 
        desc="Pasta & Wings"/> 
        <Card title="Pizza Hut" cost="15.24"
        desc="Cheese sticks and Meat Lover's Pizza" />
        <Card title="Freebirds" cost="12.99"
        desc="Steak burrito and Hornitos"/>
        <Card title="Hana Kitchen" cost="9.99"
        desc="Large Chicken Bowl & Boba"/>
      </div>  
      </div>
    );
  }
}

export default Incomplete;
